How to sort an array of objects by multiple fields?
I have an array of objects and I want to sort them by a field. I want to use case-sensative sorting. I tried this:
var arr = [{name: 'a'}, {name: 'A'}, {name: 'b'}];
arr.sort(function(a, b) {
    return a.name > b.name;
console.log(arr);
But it returns:
[ { name: 'A' }, { name: 'a' }, { name: 'b' } ]
How can I get the result:
[ { name: 'a' }, { name: 'A' }, { name: 'b' } ]
javascript sorting case-sensitive
marked as duplicate by Felix Kling , Bergi , jfriend00 , Barmar , Graviton Mar 6 '13 at 2:34
up vote 1 down vote accepted You can use localeCompare :
arr.sort(function(a, b) {
    return a.name.localeCompare(b.name);
You can also use a locale-specific sort function:
arr.sort(function(a, b) {
    return a.name.localeCompare(b.name, 'en');
You can also use a locale-specific sort function:
arr.sort(function(a, b) {
    return a.name.localeCompare(b.name, 'en');
This is not necessary. The default locale is en-US . –  Felix Kling Mar 5 '13
